import TeacherHeader from "./TeacherHeader";
import { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import './TeacherMyCourses.css';
import QuizResChild from "./QuizResChild";

const baseUrl='http://127.0.0.1:8000/api';

function QuizResult() {
    useEffect(() => {
        document.title = 'Quiz Result';
    });

    const [resultData, setResultData] = useState({});
    const { quiz_id, user_id } = useParams();
    console.log(user_id)

    useEffect(() => {
        axios
          .get(`${baseUrl}/fetch-quiz-result/${quiz_id}/${user_id}/`)
          .then((res) => {
            setResultData(res.data);
          })
          .catch((error) => {
            console.log(error);
          });
      }, [quiz_id, user_id]);

    return (
        <>
            <h1>Quiz Result</h1>
            <QuizResChild quiz={quiz_id} user={user_id}/>
        </>
    );
}

export default QuizResult;
